
CREATE TABLE mytable(
   Groupe                  VARCHAR(4) NOT NULL 
  ,IFNG874                VARCHAR(2) NOT NULL
  ,unstimulated_IFNy_pgml NUMERIC(7,2) NOT NULL
  ,PHA_IFNy_pgml          NUMERIC(8,2) NOT NULL
  ,Ag_IFNy_pgml           NUMERIC(7,2) NOT NULL
  ,CD3_number             NUMERIC(7,2) NOT NULL
  ,PHA_normalized         NUMERIC(5,2) NOT NULL
  ,Ag_normalized          NUMERIC(4,2) NOT NULL
  ,IGRA_result            VARCHAR(8) NOT NULL
  ,TST_result             VARCHAR(8) NOT NULL
  ,Sex                    VARCHAR(1) NOT NULL
  ,Age                    INTEGER  NOT NULL
  ,Ethnic_background      VARCHAR(9) NOT NULL
);

select distinct groupe from mytable; /*  TST-   TST+    TB  */
select distinct IFNG874 from mytable;/* AA     TA     TT*/
select distinct igra_result from mytable;   /*positive    negative*/
select distinct tst_result from mytable;   /* positive    negative*/
select distinct sex from mytable;      /*   M    F   */
select distinct ethnic_background from mytable;   /*   white    non_white   */

select * from mytable

declare
begin

update mytable set GROUPE = (case
                                  when GROUPE like 'TST+' then '1'
                                  when GROUPE like 'TST-' then '2'
                                  when GROUPE like 'TB' then '3'
                                 end );
                                 
update mytable set IFNG874 = (case
                                  when IFNG874 like 'AA' then '1'
                                  when IFNG874 like 'TA' then '2'
                                  when IFNG874 like 'TT' then '3'
                                  end);  
                                  
update mytable set igra_result = (case
                                  when igra_result like 'POSITIVE' then '1'
                                  when igra_result like 'NEGATIVE' then '0'
                                     end);
                                     
update mytable set tst_result = (case
                                  when tst_result like 'POSITIVE' then '1'
                                  when tst_result like 'NEGATIVE' then '0'
                                  end);   
                                  
update mytable set sex = (case
                                  when sex like 'M' then '1'
                                  when sex like 'F' then '2' 
                                  end);
                                  
update mytable set ethnic_background = (case
                                  when ethnic_background like 'WHITE' then '1'
                                  when ethnic_background like 'NON_WHITE' then '2'
                                  end);
end ;


select * from mytable;

#drop table mytable purge;









